import axios from "axios";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

const p = (a) => {
  console.log(a);
};
const About = (props) => {
  return (
    <>
      <div className="box">
        <Link to={"/"}>
          <button className="btn btn-secondary">
            <big>Home</big>
          </button>
        </Link>
        <h2>About This Project</h2>
      </div>
      <div>
        <ul class="list-group">
          <li className="list-group-item list-group-item-action list-group-item-dark"><h3>Create-React-App</h3><p>A </p></li>
          <li className="list-group-item list-group-item-action list-group-item-dark"><h3>Mongo DB</h3><p>A non-relational database (non-SQL) that plays nicely with json</p></li>
          <li className="list-group-item list-group-item-action list-group-item-dark"><h3><link to={""}>Bootstrap</link></h3><p>Most popular front-end open source toolkit</p></li>
      
        </ul>
      </div>
    </>
  );
};

export default About;
